func TestParseFares(t *testing.T) {
	var fares []fare
	sr, err := iohlp.MakeSectionReader(strings.NewReader(faresJSON), 1<<20)
	if err != nil {
		t.Fatal(err)
	}
	if err := json.NewDecoder(io.NewSectionReader(sr, 0, sr.Size())).Decode(&fares); err != nil {
		t.Error(err)
	} else if got, wanted := len(fares), 231; got != wanted {
		t.Errorf("parsed %d ares, wanted %d", got, wanted)
	}
	t.Log(len(fares))
}

